import { useContext } from "react";
import { globalContext } from "./App";
// import Cart from "./cart";

function AddToCart() {
    const {card, setCard} = useContext(globalContext);
    return (<div>
        <h1 style={{margin:20}}>Cart</h1>
        <div>
            <div style={{width:700, height:150, backgroundColor:'white', boxShadow:'0px 4px 8px rgba(0,0,0,0.9)', margin:20, borderRadius:10, padding:50, paddingTop:20, paddingBottom:20}}>
                <img src={card.path} alt="pic" width={130} height={150} />
            </div>
            <div>
                <p>{card.title}</p>
            </div>
        </div>
    </div>)
}
export default AddToCart;
